import React from 'react'
import hackmerced from './images/hackmerced.png';
import trees from './images/trees.png';

function Scene() {
    return (
        <div className='Scene'>
            <section>
                <img className='Hackmerced' src={hackmerced} alt="hackmerced"/>
                <img className='Trees' src={trees} alt="trees"/>
            </section>
        </div>
    );
}

export default Scene;
